pragma solidity ^0.4.18;

contract Seriality {

    // constructor
    function Seriality() public {}

    function sizeOfString(string _in) internal pure  returns(uint _size){
        _size = bytes(_in).length / 32;
        if (bytes(_in).length % 32 != 0) 
            _size++;

        _size++; // first 32 bytes is reserved for the size of the string     
        _size *= 32;
    }

    function boolToBytes(uint _offst, bool _input, bytes memory _output) internal pure {
        uint8 x = _input == false ? 0 : 1;
        assembly {
            mstore(add(_output, _offst), x)
        }
    }

    function stringToBytes(uint _offst, bytes memory _input, bytes memory _output) internal {
        uint256 stack_size = _input.length / 32;
        if(_input.length % 32 > 0) stack_size++;

        assembly {
            let index := 0
            stack_size := add(stack_size,1)//adding because of 32 first bytes memory as the length
        loop:

            mstore(add(_output, _offst), mload(add(_input,mul(index,32))))
            _offst := sub(_offst , 32)
            index := add(index ,1)
            jumpi(loop , lt(index,stack_size))
        }
    }

    function uintToBytes(uint _offst, uint _input, bytes memory _output) internal pure {
        assembly {
            mstore(add(_output, _offst), _input)
        }
    }  
}

contract ReservationContract is Seriality {

    /*
    * Events
    */

    event RegisterProductEvent(
      string providerEmail,
      string reservationId
    );

    /*
    * Storage
    */

    address owner;

    string id;
    string crsId;
    string sellChannel;
    Product[] products;
    uint totalPrice;
    Customer customer;

    mapping(uint => address) public addresses;
    uint idx;

    uint[5] arraytest;

    struct Customer {
        string name;
        string surname;
        string email;
        string country;
    }

    struct Product {
        uint id; // linea de reserva
        //  string productId;
        string name;
        uint price;
        uint numAdults;
        uint numChildren;
        uint numBabies;
        Provider provider;
        bool isValidated;
    }

    struct Provider {
        string id;
        string name;
        string email;
    }

    /**
    * @dev Contract constructor
    */
    // constructor (
    function ReservationContract(
        string _id, 
        string _crsId, 
        string _sellChannel, 
        string customerName,
        string customerSurname,
        string customerEmail,
        string customerCountry
    ) public {
        idx = 0;

        owner = msg.sender;

        id = _id;
        crsId = _crsId;
        sellChannel = _sellChannel;

        customer = Customer({
            name: customerName,
            surname: customerSurname,
            email: customerEmail,
            country: customerCountry
        });

        totalPrice = 0;

        addresses[0] = msg.sender;

        // arraytest.push(uint(1));
        arraytest[0] = 1;
    }

    /*
